import React from "react";
import { Switch, Route } from "react-router-dom";
import Sample from "./Sample";
import WelcomePage from "./WelcomePage";

const Routes = () => {
  return (
    <Switch>
      <Route exact path="/" />
      <Route exact path="/sample" component={Sample} />
    </Switch>
  );
};

export default Routes;
